import styled from 'styled-components';

export default function Layout({ children }) {
  return (
    <Wrapper>
      <header>COVID-19 Stats</header>
      <div>{children}</div>
      <footer>Tester</footer>
    </Wrapper>
  );
}

const Wrapper = styled.div`
  min-height: 100ch;
  header {
    background: white;
  }
`;
